      .then(res => res.json())
      .then(
        (result) => {
          console.log(result)
        });

  }
  return (
    <div className="App">
      <h1>Hello World</h1>
      <button type="button" onClick={getData}>Get Data</button>

    </div>
  );
}

export default App;
